import { IThemeConfig } from '../interfaces';

export const lightThemeConfig: IThemeConfig = {
	backgroundColor: 'white',
	searchBarColor: 'white',
	shadowBox: 'rgba(188, 188, 188, 0.503)',
	textColor: '#1b4f51',
	titleColor: '#1b4f51',
	border: '2px rgba(17, 144, 153, 0.418) solid',
};

export const darkThemeConfig: IThemeConfig = {
	backgroundColor: '#212121',
	searchBarColor: '#292E38',
	shadowBox: 'rgba(27, 27, 27, 0.176)',
	textColor: '#efefef',
	titleColor: '#10bdca',
	border: 'none',
};
